import React, { Fragment } from "react";

import MealImage from "../../assets/meals.jpg";

const Header = () =>{
    return  (
    <Fragment>
        <header>
            <h1>Meals</h1>
            <button>Cart</button> 
        </header>
        <image src={MealImage} alt="A table of meal"></image>
    </Fragment>
    )
}

export default Header;
